import React, {Component} from "react";

class TrainersSection extends Component {
    render () {
        return (
            <div className = "trainersSection">


                <style jsx>{`
                    .trainersSection {
                        font-family: Lato;                    
                    }

                    .trainersSection .shoutout {
                        font-weight: 700;
                        padding-left: 20px;
                        font-size: 20px;
                    }

                    .trainersSection p {
                        padding-left: 20px;
                    }
                `}</style>
            </div>
        );
    }
}

export default TrainersSection;
